function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
      <div>
        <Header />
        <Routes>
              <Route path="/" element={<Body />} />
              <Route index element={<MainComponent />} />
              <Route path="/watch" element={<Watch />} />
        </Routes>
      </div>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
